import React from 'react';
import Link from 'react-router-dom'
function Navlist(props){
    if(props.name==='Bubble Sort'){
        return(
            <li className="nav-item">
                <Link to={props.useref} className="nav-link dropdown active">{props.name}</Link>
            </li>
        );
    }
    else if(props.name==='Insertion Sort'){
        return(
            <li className="nav-item">
                <Link to={props.useref} className="nav-link dropdown active">{props.name}</Link>
                <a href={props.useref} className="nav-link dropdown active">{props.name}</a>
            </li>
        );
    }
    else if(props.name==='Selection Sort'){
        return(
            <li className="nav-item">
                <Link to={props.useref} className="nav-link dropdown active">{props.name}</Link>
                <a href={props.useref} className="nav-link dropdown active">{props.name}</a>
            </li>
        );
    }
    else if(props.name==='Merge Sort'){
        return(
            <li className="nav-item">
                <Link to={props.useref} className="nav-link dropdown active">{props.name}</Link>
            </li>
        );
    }
    // else{
    //     return(
    //         <li className="nav-item">
    //             <a href={props.useref} className="nav-link dropdown">{props.name}</a>
    //         </li>
    //     );
    // }
}
export default Navlist;
